import React from 'react';
import "slick-carousel/slick/slick.css";  
import "slick-carousel/slick/slick-theme.css";  
import Slider from "react-slick"; 

import "./home.css"

/**
* @author
* @function Home
**/

export const Home = (props) => {
var settings = {  
          dots: true,  
          infinite: true,  
          speed: 500,  
          centerMode: true,  
          slidesToShow: 1,  
          slidesToScroll: 1  
          };  
  return (
    <div className="home-parent">
      <div className="fetured-articles">
          <div className="featured-article-1"></div>
          <div className="featured-article-2"></div>
          <div className="featured-article-3"></div>
        </div>
      <div>
      <div class='container' >
        <div className="row title" style={{marginBottom: "20px"}} ></div>    
      </div>  
      <Slider {...settings} >  
          <div className="featured-article-1"></div>
          <div className="featured-article-2"></div>
          <div className="featured-article-3"></div>
        {/* <div className="wdt">  
          <img  className="img" src= {'./../../images/download.jfif'} className="img"/>  
        </div>   */}
      </Slider>  
    </div>
      <div className="latest-articles">
          <div className="The-Latest-heading">The Latest</div>
          <div className="Red-line"><hr/></div>
          <div className="latest-article-cards"></div>
        </div>
    </div>
        );  
 }
